        dataStream: 'Introducing Univer: A Revolution in Collaborative Productivity\r\rUniver was born from a simple yet profound insight: the need for a seamless, integrated platform where work flows freely, without the constraints of disjointed contexts or the hassle of \bswitching formats. With Univer, we enable users to create any forms of page as they wish. By merging sheet, doc and slide into a singular file, Univer empowers teams to manage, create, and collaborate without barriers.\r\rThe End of Fragmented File Sharing\r\r\bSay goodbye to the endless cycle of opening, editing, and sharing multiple files in different formats. Our platform allows you to create or consolidate everything from data analysis to comprehensive reports into one Univer file, simplifying the way you share deliverables. No more juggling between attachments or navigating through zipped folders.\r\rPowerful Data Processing and AI-Driven Automation\r\rUniver doesn’t stop at merging documents, it brings cutting-edge data processing and automation across all its pages. We’ve embedded over 500 Excel-syntax formulas within doc and slide, you can effortlessly reference and calculate data directly from sheet. For example, when you are drafting a metrics report, you can write a formula in the doc page to get the result from a specific data range in the sheet page. If the data source is changed, the result in the doc would be updated simultaneously. This real-time data linkage ensures that your work is always up to date, without the need for manual re-entry or cross-referencing.\r\rFurthermore, Univer’s AI-powered Uniscript opens new horizons for workflow automation. From generating tailored report templates to integrating specific data sources, Uniscript transforms tedious, repetitive tasks into automated processes. Univer’s expansive data integration allows you to fetch data anywhere, from MongoDB to PostgreSQL, you can also upload local files in various formats (xlsx, xls, ppt, pptx, doc, docx, pdf, csv, txt). Whether you prefer cloud based solutions or working with local files, Univer has got you covered.\r\rA User Experience Unmatched\r\r\b\bUniver is designed with practicality and simplicity. With the 2-way split editor window, Univer allows users to work on documents seamlessly. Ever needed to get a chart from a spreadsheet into a slide? Now it’s as easy as dragging and dropping. No more copying and pasting, just pick it up and place it as you wish. When you’re looking for differences in pages, simply put them side by side and diffs will get highlighted like spotlights on a dark stage. And with synchronous scrolling, you can compare and pinpoint documents in mirror like precision. It’s not just about keeping you in sync, ultimately, it’s about simplifying your workflow.\r\rFor Developers, by Developers\r\rWe’re building Univer not just as a tool, but as a collaborative productivity platform. We’re keen to hear your thoughts, feedback, and how you envision using Univer in your workflow. Join our Discord group chat to dive deeper into discussions, share insights, and connect with fellow users to explore the possibility of Univer. Let’s build better, together.\r\r\n',
